# Creating 'donors' table in a 'fundraising_v2' schema

CREATE TABLE IF NOT EXISTS fundraising_v2.donors(
   donor_id            INTEGER  NOT NULL PRIMARY KEY 
  ,donor_type          VARCHAR(12) NOT NULL
  ,donation_date       VARCHAR(118) NOT NULL
  ,donation_amount     VARCHAR(67) NOT NULL
  ,acquisition_channel VARCHAR(15) NOT NULL
  ,age                 VARCHAR(2)
  ,gender              VARCHAR(10)
  ,location            VARCHAR(31) NOT NULL
);
